import React from "react";
import { Col, Row } from "react-bootstrap";

function Posts() {
  return (
    <div className="content">
      <Row className="fw-bold p-2 row justify-content-center">
        <Col md="auto" xl="auto" className="p-1">
          <small>Showing Events(s)</small>
        </Col>
        <Col md="auto" xl="auto">
          <div className="d-flex justify-content-center">Data</div>
        </Col>
      </Row>

      <Row className="row justify-content-center">Data</Row>
    </div>
  );
}

export default Posts;
